class Event extends Component {
    render() {
      return (
        <React.Fragment>
          <h3>
            {this.props.time} - {this.props.title}
          </h3>
        </React.Fragment>
      );
    }
  }
class App extends Component {
    state = {};
    render() {
      return (
        <React.Fragment>
          <MDBContainer>
            <MDBRow>
              <MDBCol md="9">
                <Event title="Meeting with John" time="10:00" />
              </MDBCol>
              <MDBCol md="3" />
            </MDBRow>
          </MDBContainer>
        </React.Fragment>
      );
    }
  }
